import React from 'react'
import { useState } from 'react';
import { Button, Form } from 'react-bootstrap';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';

const PlaceOd = () => {

    let history = useNavigate()
    const [order, setOrder] = useState({
        mobileNo: "",
        productName: "",
        couponCode: "",
    })
    const { mobileNo, productName, couponCode } = order;
    const onInputChange = (e) => {
        setOrder({ ...order, [e.target.name]: e.target.value });
    };
    const sumitHandler = async (e) => {
        e.preventDefaut();
        await axios.post('http://localhost:8080/placeorder', order);
        history("/");
    }

    return (
        <div style={{ marginTop: "100px", marginLeft: "200px", border:"5pxblue"}}>
         <div></div>
        <div style={{
           
            overflow: "auto", width: "400px", height: "400px", boxShadow: ' 5px 5px 10px #808080'
        }}>
             
            <div style={{background:"blue", height:"50px"}}>
            <h1 style={{ textAlign: 'center', color: 'white' }}>Place Order</h1>
            </div>
            <div div style={{padding: '20px', border:"5px solid blue"}}>
            <Form onSubmit={(e) => sumitHandler(e)}>
                <Form.Group className="mb-3" >
                    <Form.Label>Mobile_No</Form.Label>
                    <Form.Control type="text" placeholder="10-digit" name="mobileNo" value={mobileNo} onChange={(e) => onInputChange(e)} />
                </Form.Group>
                <Form.Group className="mb-3" >
                    <Form.Label>Product_Name</Form.Label>
                    <Form.Control type="text" name="productName" value={productName} onChange={(e) => onInputChange(e)} />
                </Form.Group>
                <Form.Group className="mb-3" >
                    <Form.Label>Coupon_Code</Form.Label>
                    <Form.Control type="text" name="couponCode" value={couponCode} onChange={(e) => onInputChange(e)} />
                </Form.Group>

                <div style={{marginTop:'25px'}}>
                    <Button style={{ marginLeft: '10px' }} type="submit"  >Send </Button>
                    <Link to="/">
                        <Button style={{ marginLeft: '30px' }} variant="primary">cancel</Button>
                    </Link>
                </div>
            </Form>
        </div>
        </div>
        </div>
    )
}

export default PlaceOd
